your own mobile, desktop or web application, and cause that application to connect to our servers for any purposes, we refer to that resulting application as an “Open Source App”.  All Open Source Apps are subject to, and may only be used and/or commercialized in accordance with, the Terms of Use applicable to the Wire Application, which can be found at https://wire.com/legal/#terms.  Additionally, if you choose to build an Open Source App, certain restrictions apply, as follows:</p>\n<p>a. You agree not to change the way the Open Source App connects and interacts with our servers; b. You agree not to weaken any of the security features of the Open Source App; c. You agree not to use our servers to store data for purposes other than the intended and original functionality of the Open Source App; d. You acknowledge that you are solely responsible for any and all updates to your Open Source App. </p>\n<p>For clarity, if you compile the open source software that we make available from time to time to develop your own mobile, desktop or web application, and do not cause that application to connect to our servers for any purposes, then that application will not be deemed an Open Source App and the foregoing will not apply to that application.</p>\n<p>No license is granted to the Wire trademark and its associated logos, all of which will continue to be owned exclusively by Wire Swiss GmbH. Any use of the Wire trademark and/or its associated logos is expressly prohibited without the express prior written consent of Wire Swiss GmbH.</p>\n"},{"html":"<h1 id=\"undefinedhow-to-build-the-open-source-client\">How to build the open source client</h1>\n"},{"html":""},{"html":"<h2 id=\"undefinedwhat-is-included-in-the-open-source-client\">What is included in the open source client</h2>\n<p>The project in this repository contains the Wire for Android client project. You can build the project yourself. However, there are some differences with the binary Wire client available on the Play Store. \nThese differences are:</p>\n<ul>\n<li>the open source project does not include the API keys of YouTube, Localytics, HockeyApp and other 3rd party services.</li>\n<li>the open source project links agains the open source Wire audio-video-signaling (AVS) library. The binary Play Store client links against an AVS version that contains proprietary improvements for the call quality.</li>\n</ul>\n"},{"html":"<h2 id=\"undefinedprerequisites\">Prerequisites</h2>\n<p>In order to build Wire for Android locally, it is necessary to install the following tools on the local machine:</p>\n<ul>\n<li>JDK 8</li>\n<li>Android SDK</li>\n</ul>\n"},{"html":"<h2 id=\"undefinedhow-to-build-locally\">How to build locally</h2>\n<ol>\n<li>Check out the wire-android repository. </li>\n<li>From the checkout folder, run <code>./gradlew assembleProdRelease</code>. This will pull in all the necessary dependencies from Maven.</li>\n</ol>\n<p>These steps will build only the Wire client UI, pulling in all other Wire frameworks from Maven. If you want to modify the source/debug other Wire frameworks, you can check project dependencies and build other wire projects separately. The most interresting projects to check are: </p>\n<ul>\n<li><a href=\"https://github.com/wireapp/zmessaging-android\">zmessaging-android</a></li>\n<li><a href=\"https://github.com/wireapp/avs\">avs</a></li>\n<li><a href=\"https://github.com/wireapp/generic-message-proto\">generic-message-proto</a></li>\n<li><a href=\"https://github.com/wireapp/wiretranslations-android\">wiretranslations-android</a></li>\n</ul>\n"}]}</script><script type="text/javascript">!function(e){function t(r){if(n[r])return n[r].exports;var o=n[r]={exports:{},id:r,loaded:!1};return e[r].call(o.exports,o,o.exports,t),o.loaded=!0,o.exports}var n={};return t.m=e,t.c=n,t.p="/",t(0)}(function(e){for(var t in e)if(Object.prototype.hasOwnProperty.call(e,t))switch(typeof e[t]){case"function":break;case"object":e[t]=function(t){var n=t.slice(1),r=e[t[0]]
